   - Look for specific fee types: "setup fee", "monthly retainer", etc.
   - Payment terms typically include currency, method, and timing
   - Watch for volume discounts with thresholds and percentages


   Term Dates:
   - Look for "commence", "effective date", or "begin" for start date
   - "terminate" or "end" for end date
   - Renewal terms usually mentioned after term dates
   - Notice period often specified in days


   Legal Provisions:
   - "governed by" indicates governing law
   - Look for "dispute resolution" or "resolved through"
   - Confidentiality terms often specify duration and exceptions
   - Liability caps usually mentioned with specific amounts
   - Force majeure may be mentioned as valid/not valid reason
   - Assignment terms typically state if "prohibited" or "permitted"


   Data Security:
   - Look for specific encryption standards
   - Data retention periods are usually in specific time units
   - Breach notification typically specified in hours


